&quot;Your Betrayal&quot; is a song by Welsh metal band Bullet for My Valentine, the song is released as the first single from their third upcoming album, Fever. The single was set for release on March 9, 2010, with a music video following soon after. But, unexpectedly, was released early as a digital single on iTunes on March 2, 2010, along with the track &quot;Begging for Mercy&quot;, which was offered as a free download by the band on February 14, 2010 on their official website for a limited time.

